pragma solidity ^0.8.0;

interface IPaymentReceiver {
    function receivePayment() external payable;
}

contract PaymentCaller {
    IPaymentReceiver public receiver;

    constructor(address _receiver) {
        receiver = IPaymentReceiver(_receiver);
    }

    function sendPayment() external payable {
        receiver.receivePayment{value: msg.value}();
    }
}

